import { LGOIN_USER, REGISTER_USER } from '../_actions/types';

export default function (state = {}, action) {
  switch (action.type) {
    case LGOIN_USER:
      return { ...state, loginSuccess: action.payload };
      break;
    case REGISTER_USER:
      return { ...state, register: action.payload };
      break;
    default:
      return { ...state };
  }
}
